      /// Destroy the symbol.
      ~basic_symbol ()
      {
        clear ();
      }

      /// Destroy contents, and record that is empty.
      void clear ()
      {
        // User destructor.
        symbol_kind_type yykind = this->kind ();
        basic_symbol<Base>& yysym = *this;
        (void) yysym;
        switch (yykind)
        {
       default:
          break;
        }

        // Value type destructor.
switch (yykind)
    {
      case symbol_kind::S_PATTERN_BYTE: // PATTERN_BYTE
        value.template destroy< MaskedByte > ();
        break;

      case symbol_kind::S_pattern_match_body: // pattern_match_body
      case symbol_kind::S_pattern_byte_list: // pattern_byte_list
        value.template destroy< PatternByteList > ();
        break;

      case symbol_kind::S_attribute_value: // attribute_value
        value.template destroy< attribute_value_t > ();
        break;

      case symbol_kind::S_BOOL: // BOOL
        value.template destroy< bool > ();
        break;

      case symbol_kind::S_INTEGER: // INTEGER
        value.template destroy< expression_value_t > ();
        break;

      case symbol_kind::S_identifier_set_full: // identifier_set_full
      case symbol_kind::S_identifier_set: // identifier_set
        value.template destroy< identifier_set_t > ();
        break;

      case symbol_kind::S_expression: // expression
        value.template destroy< std::shared_ptr<Expression> > ();
        break;

      case symbol_kind::S_IDENTIFIER: // IDENTIFIER
      case symbol_kind::S_STRING: // STRING
      case symbol_kind::S_string: // string
        value.template destroy< std::string > ();
        break;

      default:
        break;
    }

        Base::clear ();
      }

